parts.text:
```json
{
"application": "PBS",
"software": [
"matlab",
"Anaconda/2.3.0"
],
"resources": [
{
"name": "nodes",
"description": "Number of compute nodes requested",
"example": "nodes=4:ppn=8:gpus=4"
},
{
"name": "walltime",
"description": "Maximum job runtime in HH:MM:SS",
"example": "walltime=01:10:00"
},
{
"name": "queue",
"description": "Queue name for job submission",
"options": [
"normal_q",
"largemem_q",
"dev_q",
"vis_q",
"v100_normal_q"
]
},
{
"name": "account",
"description": "Allocation account for billing CPU hours",
"example": "PBS -A RadarDQN"
},
{
"name": "modules",
"description": "Software modules to load",
"example": "module load matlab/R2018a"
}
],
"environment_variables": [
{
"name": "PBS_O_WORKDIR",
"description": "Directory from which the job was submitted"
},
{
"name": "PBS_NODEFILE",
"description": "File containing list of cores available to the job"
},
{
"name": "PBS_GPUFILE",
"description": "File containing list of GPUs available to the job"
},
{
"name": "PBS_JOBID",
"description": "Job ID (e.g., 107619.master.cluster)"
},
{
"name": "PBS_NP",
"description": "Number of cores allocated to the job"
}
],
"storage_locations": [
{
"name": "HOME",
"description": "Home directory for permanent files"
},
{
"name": "WORK",
"description": "Work directory for fast I/O"
},
{
"name": "TMPFS",
"description": "In-memory file system for very fast, small I/O"
},
{
"name": "TMPDIR",
"description": "Local disk space for this job"
}
]
}
```
